import React, { Component } from 'react'

export default class WinnersPanel extends Component {
  constructor(props) {
    super(props);
  }
  render(){
    console.log(this.props.winnerArr);
    return(
      <div>
        <table>
        <thead><tr><th>Rank</th><th>Winner Address</th><th>Amount</th></tr></thead>
        <tbody>
          {(this.props!==undefined&&this.props.winnerArr!==undefined)?
            this.props.winnerArr.map((address,index)=>{
              console.log(this.props.winnerArr[0]);
              <tr><td>{index}</td><td>{address}</td><td>{this.props.winnerAmountArr[index]}</td></tr>
            }):<tr></tr>
          }
        </tbody>
        </table>
      </div>
    );
  }
}
